<table width="100%" border="0" cellpadding="5" cellspacing="0" id="detail">
  <tr>
    <td class="minititle"><p>■商品仕様</p></td>
  </tr>

  <tr>
    <td width="30%"><p>サイズ<BR>
　約55cm×55cm×35cm</p></td>
  </tr>
  <tr>
    <td><p>素材<BR>
　表地 ／ 綿 100％<BR>
　中身 ／ ポリエステル 100％</p></td>
  </tr>
  <tr>
    <td><p>生産国<BR>
　中国製</p></td>
  </tr>

  <tr>
    <td class="img_atten"><p><strong>※※※他店舗でも同時販売しておりますので、売り違い（売り切れ）の際にはご容赦くださいますようお願い致します。</strong></p>      <p></p></td>
  </tr>
  <tr>
    <td class="minititle"><p>■商品コメント</p></td>
  </tr>
  <tr>
    <td>
     <p>・言わずと知れたおしゃれの定番にして必須の生地アイテム「デニム」。</p>
     <p>・使い込んであるような風合いに仕上げたユーズド加工。生地の端も切りっぱなしがイイ感じ♪　男性・女性を問わずお使いいただけるお部屋に馴染みやすい仕上がりです。</p>
     <p>・使い始めから味のある雰囲気で、男性・女性を問わずお使いいただけるお部屋に馴染みやすい仕上がりです。</p>
     <p>・姿勢に合わせてカラダにフィットするビーズソファ・クッションは、カラダにかかる負担が分散されるおかげで疲れにくく快適に過ごすことが出来ます。</p>
     <p>・あなたにとってちょうどいいお好きな体勢やポジションを探して、まったりくつろぎタイムをお楽しみください♪</p>
     <p>・カバーと中身が別々になっているので、外側カバーが汚れたら、外して洗えます！</p>
     <p>・洗濯を繰り返すことで、生地の風合い色合いも変化し、味わいが増します♪</p>
    </td>
  </tr>
  <tr>
    <td class="minititle"><p>■ご注文に際しての注意</p></td>
  </tr>
  <tr>
    <td class="img_atten">
     <p>・掲載している商品画像は、実際の色味を再現できるよう調整しておりますが、ご覧頂いておりますPCモニタ・携帯端末の画面等の環境や、実際に敷くお部屋の照明等の光加減に左右されますので、予めご了承の上ご注文くださいますようお願い致します。</p>
     <p>・また、生地や加工の性質上、商品一点一点で色の濃さ・色合い・かすれ具合などが異なります。これもデニム生地の味わいの一つですので、ご了承のうえお楽しみください。</p>
    </td>
  </tr>
</table><div id="new_item_bn">
  <img src="http://image.rakuten.co.jp/auc-storepocket/cabinet/parts/new_item.jpg" width="675" alt="新作商品一覧"/>
</div>

