    <td>
     <p>・足をのせてリラックス。また椅子替わりにも。いろいろ便利に使えるスツールサイズ。</p>
     <p>・米国デュポン社のタイベック使用。紙の様に見えますが、ポリエチレンを用いた不織布の一種。大変軽く、丈夫で水に強く通気性があります。使い込む事で独特のしわや風合いができます。</p>
     <p>・姿勢に合わせてカラダにフィット。カラダにかかる負担が分散され、疲れにくく快適に過ごせます。</p>
     <p>・商品の裏側にはビーズ補充用のダブルファスナーがあります。カバーは取り外しタイプではありません。</p>
     <p>・あなたにとってちょうどいいお好きな体勢やポジションを探して、まったりくつろぎタイムをお楽しみください♪</p>
     <p>※過度な衝撃を与えたり、先のとがったもので傷つけると破損の原因になります。また、暖房器具、火気付近でのご使用はお避け下さい。</p>
     <p>※商品の特性上、生地にシワがあります。不良ではございませんのでご理解の上ご購入下さい。</p>
    </td>
  </tr>
